  input: 'TEXT,F3A,,"For donors whose employer and/or occupation are reported as ''Requested,''
    we have made our best efforts to secure the necessary information. Our methods
    of collecting this information are as follows:   1.) At the time of the original
    solicitation or contribution, we have fields on the contribution form for them
    to enter employer, occupation, address, and phone number, and beneath these we
    state that federal guidelines require us to make our best efforts in obtaining
    this information for all contributions of $200 or more.  2.) If donors do not
    provide the necessary information at this initial opportunity, we follow up with
    a letter reiterating our legal obligations, and requesting that they contact us
    with the necessary information.  3.) Within a week of mailing such letters, we
    also follow up with a call to secure the necessary information.  For all donors
    that we are still unable to reach after these three attempts, we identify them
    on these reports as ''Requested.''   Also, in the RFAI that we received, dated
    August 10th, it was brought to our attention that we needed to refund $2,000.00
    to the Astro Business Venture Center. We have done so as of August 15th, and this
    refund will be reflected on subsequent reports."'
